/*
-- Query: SELECT a.id, a.product_id, "pricerent" as field, 
if(b.old_value is NULL or b.old_value = '' or b.old_value = "VND", a.old_value, if(b.old_value ='USD',  a.old_value*23016, a.old_value)) as old_value, 
if(b.new_value is NULL or b.new_value = '' or b.new_value = "VND", a.new_value, if(b.new_value ='USD', a.new_value*23016,  a.new_value)) as new_value, 
a.group, a.user_id, a.created_at
FROM (SELECT * FROM admin_pizo.lck_product_change_log where field = "pricerent") as a
LEFT JOIN (SELECT * FROM admin_pizo.lck_product_change_log where field = "monthly_price_unit") as b
ON a.user_id = b.user_id and a.created_at = b.created_at
order by a.created_at
-- Date: 2021-02-28 02:23
*/
